import React, { Fragment } from "react";
import Context from "../context//context";


const Building = () => {
  return <Floor1 />;
};
//Floor1 Component
const Floor1 = () => {
  return <Floor2 />;
};

//Floor2 Component
const Floor2 = () => {
  return <Floor3 />;
};

//Floor3 Component
const Floor3 = () => {
  return <Floor7 />;
};
const Floor7 = () => {
  return (
    <Context.Consumer>
      {context => (
        <Fragment>
          <p>
            <strong>Project Name: </strong>
            {context.data.projectName}
          </p>
          <p>
            <strong>Recipient Name: </strong>
            {context.data.managerName}
          </p>
          <p>
            <strong>Sprint: </strong>
            {context.data.sprint}
          </p>
          <p>
            <strong>Attendence: </strong>
            {context.data.attendence}
          </p>
          <button className='bottom-btn' onClick={context.attendence}>
            Update Delivery Status
          </button>
        </Fragment>
      )}
    </Context.Consumer>
  )
}
export default Building;
